            \u0074\u0072\u0079 
            {
                \u0072\u0065\u0074\u0075\u0072\u006E  \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0038\u0031\u0035 .\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0034\u0037 ();
            }
            \u0063\u0061\u0074\u0063\u0068  (\u0053\u0079\u0073\u0074\u0065\u006D .\u0045\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E \u005F\u0065\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E )
            {
\u0067\u006C\u006F\u0062\u0061\u006C ::\u004F\u0078\u0069\u0064\u0065 .\u0043\u006F\u0072\u0065 .\u0049\u006E\u0074\u0065\u0072\u0066\u0061\u0063\u0065 .\u004F\u0078\u0069\u0064\u0065 .\u004C\u006F\u0067\u0045\u0072\u0072\u006F\u0072 (\u005F\u0065\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E .\u004D\u0065\u0073\u0073\u0061\u0067\u0065 + "\n" + \u005F\u0065\u0078\u0063\u0065\u0070\u0074\u0069\u006F\u006E .\u0053\u0074\u0061\u0063\u006B\u0054\u0072\u0061\u0063\u0065 );
                \u0074\u0068\u0072\u006F\u0077 ;
            }
            \u0066\u0069\u006E\u0061\u006C\u006C\u0079 
            {
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0035\u0030 (\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0038\u0031\u0035 );
            }
        }

        \u0073\u0074\u0061\u0074\u0069\u0063  \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0037\u0031 \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0037\u0034 (\u0058\u0065\u0072\u0043\u006F\u0070\u0074\u0065\u0072\u0043\u0072\u0061\u0066\u0074 \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0036\u0034\u0036 )
        {
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0037\u0031 \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0036 ;
            \u0069\u0066  (\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0034 .\u0043\u006F\u0075\u006E\u0074 > 0)
            {
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0036 = \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0034 [0];
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0034 .\u0052\u0065\u006D\u006F\u0076\u0065\u0041\u0074 (0);
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0036 .\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0037\u0033 (\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0036\u0034\u0036 );
                \u0072\u0065\u0074\u0075\u0072\u006E  \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0036 ;
            }
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0036 = \u006E\u0065\u0077  \u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0037\u0031 ();
\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0035\u0031\u0037\u0036 .\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0037\u0037\u0033 (\u0067\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0064\u005F\u0039\u0034\u0036\u0034\u0036 );
